import axios from 'axios';

const baseURL = process.env.REACT_APP_BASE_URL;

axios.defaults.withCredentials = true;

export const Login = async (id, pw) => {
  const result = await axios.post(`${baseURL}/login`, {
    id,
    pw,
  });
  return result.data.data;
};
